const titles = ["Title 1", "Title 2"];

const listItems = [
  <ListItem title={titles[0]} />,
        <ListItem title={titles[1]} />
];

function App() {
  return (
    <div className="App">
      {/* {[
        <ListItem title={titles[0]} />,
        <ListItem title={titles[1]} />
      ]} */}
      {listItems}
    </div>
  );
}

export default App;
